import React, { Component } from 'react'
import { allPosts } from '../service/PostFunctions'

//import user from '../../assets/img/USUARIO_BLACK.png'

class Feed extends Component {
    constructor(){
        state = {
            posts: ''
        }
    }

    render(){

        const  posts  = allPosts().then(res => {
            this.setState({
                [posts]: res
            })
            return res
        })



        return (
            <main className="main white">
                {console.log(this.state.bind(this))}
            </main>
        )
    }
}

export default Feed
